    labels:['Sapi','Ayam', 'Ikan', 'Kambing'],
    datasets: [
      {
        label: 'Dataset 1',
        data:[],
        borderColor: 'rgb(255, 99, 132)',
        backgroundColor: 'rgba(25, 90, 13, 0.5)',
      },
      {
        label: 'Dataset 2',
